export default function UmaMusu2() {
  const [racePoint, setRacePoint] = useState(0);
  const [formData, setFormData] = useState(initFormData);
  const [UmaList, setUmaList] = useState(umaNames.map((name) => <DragItem key={name} umaname={name}/>));
  const [lineage, setLineage] = useState(0);
  const [lineageIcon, setLineageIcon] = useState("△");

  const sortUmaIcon = (umaname) =>{
    let umalist = umaData[umaname];
    let res = Object.entries(umalist);
    res.sort(function(p1, p2){
      var p1Val = p1[1], p2Val = p2[1];
      return p1Val - p2Val;
    })
    umalist = Object.fromEntries(res);
    res = []
    
    Object.keys(umalist).forEach(key => res.push(key));
    res = res.reverse()
    setUmaList(res.map((key) => {
      if(key != ""){
        return <DragItem key={key} umaname={key}/>
      }
    }
    ))
  }

  const updateFormItem = useCallback((key, umaName, race) => {
    setFormData(prevData => {
      const newFormData = {...prevData, [key]: umaName}
      const {point, icon} = computeLineage(newFormData, race)
      setLineage(point)
      setLineageIcon(icon)
      return newFormData
    })

  }, [])
  const updateRacePoint = useCallback((race) => {
    setRacePoint(race)
    setFormData(prevData => {
      const {point, icon} = computeLineage(prevData, race)
      setLineage(point)
      setLineageIcon(icon)
      return prevData
    })
  }, [])

  return (
    <Layout>
    <div>ウマ娘相性確認！</div>
    <div className="point_view">相性：{lineageIcon}({lineage})</div>
    <DndProvider backend={selectBackend()}>
    <div className="lineage_block">
      親と祖父母の同一勝利レース数を入れてください。<br/>
      (大きな影響はないので適当にあてはめて確認するのがいいと思います。)<br/>
      <input type="number" onChange={ (e) => { setRacePoint(e.target.value) },(e) => { updateRacePoint(e.target.value) }} value={racePoint}></input>
      <div className="child">
      <DropZone areaName = "ME" updateFormItem={updateFormItem} formData = {formData} sortUmaIcon={sortUmaIcon} racePoint={racePoint} />
      </div>
      <hr className="ver bottom"/>
      <hr className="hol"/>
      <div className="border">
        <hr className="ver"/>
        <hr className="ver"/>
      </div>

      <div className="parent">
      <DropZone areaName = "MO" updateFormItem={updateFormItem} formData = {formData} racePoint={racePoint}   />
      <DropZone areaName = "FA" updateFormItem={updateFormItem} formData = {formData} racePoint={racePoint} />
      </div>
      <div className="border">
        <hr className="ver"/>
        <hr className="ver"/>
      </div>
      <div className="hr_area">
        <hr className="hol2"/>
        <hr className="hol2"/>
      </div>
      <div className="hr_area">
        <hr className="ver"/>
        <hr className="ver"/>
        <hr className="ver"/>
        <hr className="ver"/>
      </div>

      <div className="grand_parent">
      <DropZone areaName = "gmMO" updateFormItem={updateFormItem} formData = {formData} racePoint={racePoint}   />
      <DropZone areaName = "gmFA" updateFormItem={updateFormItem} formData = {formData} racePoint={racePoint}   />

      <DropZone areaName = "gfMO" updateFormItem={updateFormItem} formData = {formData} racePoint={racePoint}   />
      <DropZone areaName = "gfFA" updateFormItem={updateFormItem} formData = {formData} racePoint={racePoint}   />
      </div>
    </div>
   
    <div className="discription">育成ウマ娘との相性順にソートされます。</div>
    <div className="drop_data" id="drop_data">
      {UmaList}
      <div className="scrole_zone">スクロール→</div>
    </div>
    </DndProvider>
    </Layout>
  )
}


