const computeLineage = (formData, racePoint) => {
  let tortal_factor_point = 0;
  const ME = (umaRerationList[formData.ME] == undefined) ? [] : umaRerationList[formData.ME]
  const MO = (umaRerationList[formData.MO] == undefined) ? [] : umaRerationList[formData.MO]
  const gmMO = (umaRerationList[formData.gmMO] == undefined) ? [] : umaRerationList[formData.gmMO]
  const gmFA = (umaRerationList[formData.gmFA] == undefined) ? [] : umaRerationList[formData.gmFA]
  const FA = (umaRerationList[formData.FA] == undefined) ? [] : umaRerationList[formData.FA]
  const gfMO = (umaRerationList[formData.gfMO] == undefined) ? [] : umaRerationList[formData.gfMO]
  const gfFA = (umaRerationList[formData.gfFA] == undefined) ? [] : umaRerationList[formData.gfFA]
  const MEPoint = umaData[formData.ME][formData.MO] + umaData[formData.ME][formData.FA] 
  const PAPoint = umaData[formData.MO][formData.FA]
  console.log("MO")
  console.log(umaData[formData.ME][formData.MO])
  console.log("FA")
  console.log(umaData[formData.ME][formData.FA] )
  console.log("PAPoint")
  console.log(PAPoint)

  
  let point=[]
  let tmp = []
  if(formData.ME != formData.gmMO){
    getCommonElementsArray(ME, MO, gmMO).forEach((e)=>{
      point.push(umaReration[e])
      tmp.push(umaReration[e])
    })
  }
  console.log("gmMO")
  console.log(tmp.reduce((sum, element) => Number(sum) + Number(element), 0))
  if(formData.ME != formData.gmFA){
    getCommonElementsArray(ME, MO, gmFA).forEach((e)=>{
      point.push(umaReration[e])
      tmp.push(umaReration[e])
    })
  }
  console.log("gmFA")
  console.log(tmp.reduce((sum, element) => Number(sum) + Number(element), 0))
  if(formData.ME != formData.gfMO){
    getCommonElementsArray(ME, FA, gfMO).forEach((e)=>{
      point.push(umaReration[e])
      tmp.push(umaReration[e])
    })
  }
  console.log("gfMO")
  console.log(tmp.reduce((sum, element) => Number(sum) + Number(element), 0))
  if(formData.ME != formData.gfFA){
    getCommonElementsArray(ME, FA, gfFA).forEach((e)=>{
      point.push(umaReration[e])
      tmp.push(umaReration[e])
    })
  }
  console.log("gfFA")
  console.log(tmp.reduce((sum, element) => Number(sum) + Number(element), 0))
  
  let reration = point.reduce((sum, element) => Number(sum) + Number(element), 0);

  const lineagePoint = reration + MEPoint + PAPoint + Number(racePoint)
  let lineageIcon = ''
  if(lineagePoint > 150){
    lineageIcon = '◎'
  } else if(lineagePoint > 50){
    lineageIcon = '〇'
  } else{
    lineageIcon = '△'
  }
    
  return {point: lineagePoint, icon: lineageIcon};
};

function selectBackend(){
  return (isAndroid() || isIOS()) ? TouchBackend : HTML5Backend
}

function isAndroid() {
  return !!window.navigator.userAgent.match(/Android/);
}

function isIOS() {
  return !!window.navigator.userAgent.match(/iPhone|iPad|iPod/);
}

var getCommonElementsArray = function(){
  var i = 1, j = 0;
  function removeArrayDuplicates(array) {
    return array.filter(function(value, index, self) {
      return self.indexOf(value) === index;
    });
  }
  var cmnElmArray = arguments[0].slice();
  cmnElmArray = removeArrayDuplicates(cmnElmArray);
  var tgtElmArray = [];
  while(i < arguments.length){
    tgtElmArray = arguments[i++].slice();
    j = 0;
    while(j < cmnElmArray.length){
      if(tgtElmArray.indexOf(cmnElmArray[j])>=0){
        j++;
      }else{
        cmnElmArray.splice(j, 1);
      }
    }
  }
  return cmnElmArray;
};


